import React from 'react';
import {Container,Row,Col} from 'react-bootstrap';

const Footer = () => {

    const currentYear = new Date().getFullYear();

  return (
    
    <footer>
        <Container>
            <Row>
                <Col className=''>
                 <p>AFnaN's Shop &copy;{currentYear}</p>
                </Col>
            </Row>
        </Container>

    </footer>
  )
}

export default Footer
